ors/colors.css\" /&gt;<br>&nbsp; &nbsp; &lt;link rel=\"stylesheet\" href=\"/service/resources/css/multiple-select.css\"&gt;</pre><p><br></p><h2 style=\"font-family: &quot;Segoe UI&quot;, Arial, sans-serif; font-size: 30px; margin-top: 10px; margin-bottom: 10px; color: rgb(0, 0, 0);\">JavaScript Data Types</h2><p style=\"color: rgb(0, 0, 0); font-family: Verdana, sans-serif; font-size: 15px; line-height: 22.5px;\">JavaScript variables can hold many&nbsp;<strong>data types</strong>: numbers, strings, arrays, objects and more:</p><div class=\"w3-example\" style=\"padding: 0.01em 16px; margin-top: 20px; margin-bottom: 20px; font-family: Verdana, sans-serif; font-size: 15px; line-height: 22.5px; box-shadow: rgba(0, 0, 0, 0.156863) 0px 2px 4px 0px, rgba(0, 0, 0, 0.117647) 0px 2px 10px 0px !important; background-color: rgb(241, 241, 241);\"><div class=\"w3-code notranslate jsHigh\" style=\"font-family: Consolas, &quot;courier new&quot;; font-size: 16px; line-height: 1.4; width: auto; padding: 8px 12px; word-wrap: break-word; margin-top: 20px; margin-bottom: 20px; border-left-width: 4px !important; border-left-style: solid !important; border-left-color: rgb(76, 175, 80) !important; background-color: rgb(255, 255, 255);\"><span style=\"color: mediumblue;\">var</span>&nbsp;length =&nbsp;<span style=\"color: red;\">16</span>;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"color: green;\">// Number<br></span><span style=\"color: mediumblue;\">var</span>&nbsp;lastName =&nbsp;<span style=\"color: brown;\">\"Johnson\"</span>;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"color: green;\">// String<br></span><span style=\"color: mediumblue;\">var</span>&nbsp;cars = [<span style=\"color: brown;\">\"Saab\"</span>,&nbsp;<span style=\"color: brown;\">\"Volvo\"</span>,&nbsp;<span style=\"color: brown;\">\"BMW\"</span>];&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"color: green;\">// Array<br></span><span style=\"color: mediumblue;\">var</span>&nbsp;<span style=\"color: red;\"></span>x = {firstName:<span style=\"color: brown;\">\"John\"</span>, lastName:<span style=\"color: brown;\">\"Doe\"</span>};&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"color: green;\">// Object</span></div></div><hr style=\"border-top-color: rgb(238, 238, 238); margin-top: 20px; margin-bottom: 20px; font-family: Verdana, sans-serif; font-size: 15px; line-height: 22.5px;\"><h2 style=\"font-family: &quot;Segoe UI&quot;, Arial, sans-serif; font-size: 30px; margin-top: 10px; margin-bottom: 10px; color: rgb(0, 0, 0);\">The Concept of Data Types</h2><p style=\"color: rgb(0, 0, 0); font-family: Verdana, sans-serif; font-size: 15px; line-height: 22.5px;\">In programming, data types is an important concept.</p><p style=\"color: rgb(0, 0, 0); font-family: Verdana, sans-serif; font-size: 15px; line-height: 22.5px;\">To be able to operate on variables, it is important to know something about the type.</p><p style=\"color: rgb(0, 0, 0); font-family: Verdana, sans-serif; font-size: 15px; line-height: 22.5px;\">Without data types, a computer cannot safely solve this:</p><div class=\"w3-example\" style=\"padding: 0.01em 16px; margin-top: 20px; margin-bottom: 20px; font-family: Verdana, sans-serif; font-size: 15px; line-height: 22.5px; box-shadow: rgba(0, 0, 0, 0.156863) 0px 2px 4px 0px, rgba(0, 0, 0, 0.117647) 0px 2px 10px 0px !important; background-color: rgb(241, 241, 241);\"><div class=\"w3-code notranslate jsHigh\" style=\"font-family: Consolas, &quot;courier new&quot;; font-size: 16px; line-height: 1.4; width: auto; padding: 8px 12px; word-wrap: break-word; margin-top: 20px; margin-bottom: 20px; border-left-width: 4px !important; border-left-style: solid !important; border-left-color: rgb(76, 175, 80) !important; 